// Inicializando arrays para manhã e tarde
const morningSlots = [];
const afternoonSlots = [];

// Função para verificar se o horário é antes ou depois das 12h
function isMorning(time) {
  const hour = new Date(time).getHours();
  return hour < 15; // Agora apenas horários menores que 12 são considerados manhã 15 por conta do Fuso
}

// Loop sobre todos os itens de entrada
for (const item of $input.all()) {
  const slots = item.json.slots;

  // Itera sobre cada dia e seus horários
  for (const date in slots) {
    const times = slots[date];

    for (const slot of times) {
      const time = slot.time;

      // Verifica se o horário é antes ou depois das 12h e adiciona ao array correspondente
      if (isMorning(time)) {
        morningSlots.push({ date, time });
      } else {
        afternoonSlots.push({ date, time });
      }
    }
  }
}

// Retorna as duas listas separadamente
return [{ json: { morningSlots, afternoonSlots } }];

