// Função para pular finais de semana
function adjustForWeekend(date) {
  const dayOfWeek = date.getDay();
  // Se for sábado (6), pular para segunda-feira
  if (dayOfWeek === 6) {
    date.setDate(date.getDate() + 2);
  }
  // Se for domingo (0), pular para segunda-feira
  if (dayOfWeek === 0) {
    date.setDate(date.getDate() + 1);
  }
}

// Definir endtime para 3 dias úteis depois
for (let i = 0; i < 3; i++) {
