// Configurações
const SLOT_DURATION = 40; // duração em minutos
const START_HOUR = 9; // hora de início do dia
const END_HOUR = 18.5; // hora de fim do dia (18:30)

// Função para formatar a data com o timezone -03:00
function formatToMinusThree(date) {
  const offsetDate = new Date(date.getTime() -0 * 60 * 60 * 1000);
  return offsetDate.toISOString().replace('Z', '-03:00');
}

// Função para verificar se o horário é após o momento atual + 1 hora
function isAfterCurrentTimePlusHour(dateTimeStr) {
  const currentTime = new Date();
  currentTime.setHours(currentTime.getHours() + 1); // Adiciona 1 hora
  return new Date(dateTimeStr) > currentTime;
}

// Função principal que será executada
const processItem = (item) => {
  if (!item.json || !item.json.collection) {
    console.log('Item inválido:', item);
    return { error: 'Formato de dados inválido' };
  }

  const events = item.json.collection;
  const eventsByDay = {};

  events.forEach(evt => {
    const date = new Date(evt.start_time).toISOString().split('T')[0];
    if (!eventsByDay[date]) {
      eventsByDay[date] = [];
    }
    eventsByDay[date].push({
      start: new Date(evt.start_time),
      end: new Date(evt.end_time)
    });
  });

  // Função para verificar se é dia útil
  const isWeekday = (date) => {
    const day = new Date(date).getDay();
    return day !== 0 && day !== 6;
  };

  // Função para gerar slots disponíveis para um dia
  function getAvailableSlotsForDay(date, busySlots) {
    const availableSlots = [];
    const baseDate = new Date(date);
    baseDate.setUTCHours(START_HOUR, 0, 0, 0);

    const endDate = new Date(date);
    endDate.setUTCHours(END_HOUR, 30, 0, 0);

    let currentTime = new Date(baseDate);

    while (currentTime < endDate) {
      let slotEnd = new Date(currentTime.getTime() + SLOT_DURATION * 60000);

      // Verificar se o slot atual está livre e após o horário atual + 1 hora
      let isSlotAvailable = isAfterCurrentTimePlusHour(currentTime.toISOString());

      if (isSlotAvailable) {
        for (let busy of busySlots) {
          if (!(currentTime >= busy.end || slotEnd <= busy.start)) {
            isSlotAvailable = false;
            break;
          }
        }
      }

      // Se o slot estiver disponível, adicionar à lista
      if (isSlotAvailable) {
        availableSlots.push({
          start: formatToMinusThree(currentTime),
          end: formatToMinusThree(slotEnd)
        });
      }

      // Avançar para o próximo slot
      currentTime = new Date(currentTime.getTime() + SLOT_DURATION * 60000);
    }

    return availableSlots;
  }

  // Processar cada dia e gerar slots disponíveis
  const availableSlotsByDay = {};
  Object.keys(eventsByDay).forEach(date => {
    if (isWeekday(date)) {
      const slots = getAvailableSlotsForDay(date, eventsByDay[date]);
      if (slots.length > 0) { // Só incluir dias que tenham slots disponíveis
        availableSlotsByDay[date] = slots;
      }
    }
  });

  // Retorna o objeto no formato esperado
  const output = {
    json: {
      slots: availableSlotsByDay
    }
  };

  return output;
};

// Executa a função e retorna o resultado
return processItem(item);

